INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24001, 102301, 10046, 0.0, "アヤネ", 401, 2, 2, "2020/07/31 12:00:00", "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24002, 102301, 10046, 2.21, "アヤネ", 402, 2, 1, "2020/07/31 12:00:00", "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24003, 102301, 10046, 0.0, "アヤネ", 403, 2, 2, "2020/07/31 12:00:00", "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24004, 192201, 10046, 1.99, "アサヒ", 701, 1, 2, "2020/07/31 12:00:00", "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24005, 192201, 10046, 2.21, "アサヒ", 702, 2, 1, "2020/07/31 12:00:00", "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24006, 192201, 10046, 3.33, "アサヒ", 703, 1, 2, "2020/07/31 12:00:00", "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24007, 192301, 10046, 0.0, "部員３", 801, 2, 2, "2020/07/31 12:00:00", "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24008, 192301, 10046, 2.68, "部員３", 802, 2, 1, "2020/07/31 12:00:00", "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24009, 192301, 10046, 0.0, "部員３", 803, 2, 2, "2020/07/31 12:00:00", "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24010, 192501, 10046, 0.0, "", 501, 1, 1, "2020/07/31 12:00:00", "やった！", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24011, 192501, 10046, 0.0, "", 502, 1, 1, "2020/07/31 12:00:00", "勝ったよ！", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24012, 192501, 10046, 0.0, "", 503, 1, 1, "2020/07/31 12:00:00", "いい調子！", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24013, 113501, 10046, 5.33, "ミサト", 111, 2, 6, "2020/07/31 12:00:00", "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24014, 113501, 10046, 6.85, "ミサト", 112, 2, 1, "2020/07/31 12:00:00", "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24015, 113501, 10046, 3.0, "ミサト", 113, 2, 1, "2020/07/31 12:00:00", "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24016, 192401, 10046, 6.11, "ダイチ", 611, 2, 1, "2020/07/31 12:00:00", "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24017, 192401, 10046, 6.75, "ダイチ", 612, 2, 1, "2020/07/31 12:00:00", "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24018, 192401, 10046, 0.0, "ダイチ", 613, 2, 2, "2020/07/31 12:00:00", "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24019, 113401, 10046, 4.52, "ハツネ", 211, 1, 2, "2020/07/31 12:00:00", "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24020, 113401, 10046, 3.89, "ハツネ", 212, 1, 2, "2020/07/31 12:00:00", "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24021, 113401, 10046, 13.49, "ハツネ", 213, 2, 1, "2020/07/31 12:00:00", "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24022, 106501, 10046, 3.17, "カヤ", 311, 2, 1, "2020/07/31 12:00:00", "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24023, 106501, 10046, 4.42, "カヤ", 312, 2, 1, "2020/07/31 12:00:00", "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24024, 106501, 10046, 2.89, "カヤ", 313, 1, 6, "2020/07/31 12:00:00", "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24025, 102301, 10046, 3.71, "アヤネ", 421, 3, 4, "2020/07/31 12:00:00", "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24026, 192201, 10046, 5.1, "アサヒ", 721, 1, 2, "2020/07/31 12:00:00", "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24027, 192301, 10046, 4.34, "部員３", 821, 3, 1, "2020/07/31 12:00:00", "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (0.0, 24, 24028, 192501, 10046, 0.0, "", 521, 1, 1, "2020/07/31 12:00:00", "いい勝負だったよ\nまたやろうね", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (-360.0, 24, 24029, 113501, 10046, 5.62, "ミサト", 101, 2, 1, "2020/07/31 12:00:00", "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (-360.0, 24, 24030, 113501, 10046, 9.58, "ミサト", 102, 2, 1, "2020/07/31 12:00:00", "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (-360.0, 24, 24031, 113501, 10046, 0.0, "ミサト", 103, 2, 2, "2020/07/31 12:00:00", "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (-360.0, 24, 24032, 113501, 10046, 9.13, "ミサト", 104, 1, 2, "2020/07/31 12:00:00", "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (-360.0, 24, 24033, 113501, 10046, 8.27, "ミサト", 105, 2, 1, "2020/07/31 12:00:00", "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 0.0, "2030/12/17 14:59:59");
